import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'
import { Container } from '../Container/Container';

const Header = () => {
    return (
        <header className='headerpage'>
            <Container>
                <div className='header-flex'>
                    <img 
                    src="" 
                    alt="Imagem " 
                    />
                </div>
            </Container>
        </header>
    );
};

export default Header;
